  true,\n\t\"url\": null,\n\t\"notes\": \"The Solar Backscattered Ultra Violet (SBUV)
  from NOAA-16 Level-2 daily product (SBUV2N16L2) contains ozone nadir profile and
  total column data from retrievals generated from the v8.6 SBUV algorithm. The v8.6
  SBUV algorithm estimates the ozone nadir profile and total column from SBUV measurements
  using 1) the Brion-Daumont-Malicet ozone cross sections, 2) an OMI-derived cloud-height
  climatology, 3) a revised a priori ozone climatology, and 4) inter-instrument calibration
  based on comparisons with no local time difference.nnThe SBUV2N16L2 product is written
  as daily files using the HDF5 format, with file sizes ranging from about 1 to 5
  Mbytes. Data are available from October 2000 through July 2013. The SBUV2N16L2 data
  product was used as input in creating the SBUV2N16L3zm monthly zonal mean data product.n\",\n\t\"license_title\":
